import time
Input=""
Pattern=[0,1,0,-1]
Debug=time.time()
for z in range(0,100):
    Output=""
    Index=0
    while len(Output)<len(str(Input)):
        Index+=1
        NewPattern=[]
        for i in Pattern:
            for _ in range(0,Index):
                NewPattern.append(i)
        TempIndex=0
        Num=0
        for i in Input:
            TempIndex+=1
            if TempIndex>len(NewPattern)-1:
                TempIndex=0
            Num+=int(i)*NewPattern[TempIndex]
        Output=Output+str(int(abs(Num)%10))
    Input=Output
    if Debug+5<time.time():
        Debug=time.time()
        print(z)
print(Output[0:8])
